import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Random from './Components/Random';
import Header from './Components/Header';
import SearchForm from './Components/SearchForm';
import SearchResults from './Components/SearchResults'
import Categories from './Components/Categories'
import Nav from './Components/Nav.jsx'


const App = () => {


  return (
    <div className="App">
    <Router>
    <Header />
    <Nav />
    {/* <SearchForm />
    <SearchResults /> */}
    <Route exact path ='/random' component={Random} />
    <Route exact path='/categories' component={Categories}/>
    </Router>
    <div className='homepage'>
    <h1>Welcome to Sprinkle & Dash!</h1>
    <h3>The recipe lookup app.</h3>
    <p>Click on the categories link in the nav bar to be taken to the different categories for a recipe, or (if you're feeling adventurous) click on the Random Meal link to generate a random recipe from our database.</p>
    </div>
    </div>
  );
}

export default App;
